import React from "react";

export default function logininfo(props) {
  const style = {
    background: "#fff",
    alignSelf: "flex-start",
    order: 3,
    borderRadius: "10%",
    color: "#000",
  };

  return (
    <div style={style}>
      <p>User-name :{props.userData.username}</p>
      <p>Password : {props.userData.password}</p>
      <p>Balance : {props.userData.money}</p>
    </div>
  );
}
